var cmdBaseUri = '#!cyberRoze.md';
var iconAttr = {fill: '#E0E0E0', stroke: 'none'};
var paperz = {}, elz = {};

$(function() {
    $('body').removeClass('wait');
    
    $(document).on('contextmenu', function() {
        return false;
        });
    
    $('.icon')
    .each(function() {
	var id = $(this).attr('id'),
		icn = $(this).data('icon'),
		icn_sx = $(this).data('icon-size-x'),
		icn_sy = $(this).data('icon-size-y'),
		icn_trnsfrm = $(this).data('icon-transform'),
		icn_attr = $(this).data('icon-attr');
	if( undefined === icn_trnsfrm ) {
	    var icn_ssx = Math.round(icn_sx / 32);
	    var icn_ssy = Math.round(icn_sy / 32);
	    icn_trnsfrm = 's'+ icn_ssx + ',' + icn_ssy + ',0,0';
	    }
	if( undefined === icn_attr ) {
	    icn_attr = iconAttr;
	    }
	paperz[id] = Raphael(id, icn_sx, icn_sy);
	elz[id] = paperz[id].path(iconz[icn]).transform(icn_trnsfrm).attr(icn_attr);
    	})
    .on('mouseenter mouseleave', function(e) {
	if( false === $(this).parent().data('iconHover') || false === $(this).data('iconHover') ) { return false; }
	var id = $(this).attr('id');
        elz[id].stop();
	if( 'mouseenter' === e.type ) {
	    elz[id].animate({stroke: '#FFF', 'stroke-width': 4}).animate({fill: '#000'}, 500);
	} else {
	    elz[id].animate(iconAttr);
	}
    	});
    
    $('#front-core-container').removeClass('wait').on('click', function(e) {
	var shp = $(this).find('#shape');
	var stg = $(this).find('#stage');
	if( shp.hasClass('ring') ) {
	    shp.removeClass('ring').data('iconHover', false).addClass('cube');
	    stg.css('webkitTransform', '')
	    	  .css('mozTransform', '')
	    	     .css('transform', '');
	} else {
	    shp.removeClass('cube').data('iconHover', true).addClass('ring');
	    stg.css('webkitTransform', 'translateZ(-200px)')
	          .css('mozTransform', 'translateZ(-200px)')
	             .css('transform', 'translateZ(-200px)');
	}
	return false;
    	});
    
    $('#stage')
    .on('mouseenter mouseleave', '.ring .plane', function(e) {
	if( 'mouseenter' === e.type ) {
	    /**
	     * @FIXME Browser implementation is buggy!
	     */
//	    $('#front-core-container #shape').addClass('paused');
	} else {
//	    $('#front-core-container #shape').removeClass('paused');
	}
    	})
    .on('click', '.ring .plane', function() {
	if( undefined !== (linkURL = $(this).data('forward')) ) {
	    window.open( linkURL + '?utm_source=slashsBin&utm_medium=website&utm_campaign=slashsBin' );
	    return false;
	    }
	if( undefined !== (mask = $(this).data('mask')) ) {
	    $('#body #back-page.face .mask').removeClass('putOn').filter('#mask-' + mask).addClass('putOn');
	    var bdy = $('#body');
	    var fpage = bdy.find('#front-page');
	    var shp = fpage.find('#front-core-container #shape');
	    if( '1' === bdy.data('flip' ) ) {
		    fpage.css('display', 'block');
		    bdy.data('flip', '0' ).removeClass('flip');
		    shp.removeClass('paused');
		} else {
		    fpage.css('display', 'none');
		    bdy.data('flip', '1' ).addClass('flip');
		    shp.addClass('paused');
		}
	    }
	
	return false;
    	});
        
    $('#front-core-container').removeClass('inProgress');
    
    $('#sidebar #sidebar-cube').on('click', function() {	    
	$('#front-page').css('display', 'block')
		.find('#front-core-container #stage #shape').removeClass('paused ring').data('icon-hover', false).addClass('cube').end()
		.find('#front-core-container #stage').css('webkitTransform', '')
	    	  	       .css('mozTransform', '')
	    	  	       .css('transform', '');
	$('#body').data('flip', '0').removeClass('flip')
		  .find('#back-page.face .mask').removeClass('putOn');
	return false;
    	});
    $('#sidebar #sidebar-rainymood').on('click', function() {
        var volume = $('#sidebar #sidebar-volume').data('volume');
        var rainyMood = $('#rainy-mood');
        paperz['sidebar-rainymood'].clear();
        if( 0 === $(this).data('rain') ) {
            $(this).data('rain', 1);
            paperz['sidebar-rainymood'].path(iconz['rain']).attr(iconAttr);;
            var rainyMoodMedia = rainyMood.attr('preload', 'auto').get(0);
            rainyMoodMedia.volume = volume;
            rainyMoodMedia.play();
        } else {
            paperz['sidebar-rainymood'].path(iconz['sun']).attr(iconAttr);;
            var rainyMoodMedia = rainyMood.get(0);
            rainyMoodMedia.pause();
            $(this).data('rain', 0);
        }
        return false;
        });
    $('#sidebar #sidebar-volume').on('click', function() {
        var volume = 0, volumeLevel = $(this).data('volumeLevel');
        volumeLevel++;
        if( 3 < volumeLevel ) { volumeLevel = 0; }
        volume = volumeLevel/3;
        $(this).data('volumeLevel', volumeLevel).data('volume', volume);
        paperz['sidebar-volume'].clear();
        paperz['sidebar-volume'].path(iconz['volume' + volumeLevel]).attr(iconAttr);
        $('#rainy-mood').get(0).volume = volume;
        return false;
        });
    
    $('#footer ul li a img')
    .on('load', function() {
        $(this).removeAttr('hidden');
        })
    .each(function() {
        $(this).attr('src', $(this).attr('aria-src'));
        });
    
    $('.eMail').on('click', function() {
	var w = 500, h = 300, t = 0, l = 0;
	l = (screen.width  - w)/2;
	t = (screen.height - h)/2;
        window.open( $(this).attr('href') , 'Mohammad Shokri eMail Address',
        					'toolbar=0,\
        					scrollbars=0,\
    						location=0,\
        					statusbar=0,\
        					menubar=0,\
        					resizable=0,\
        					fullscreen=0,\
        					directories=0,\
        					width=' + w + ',height=' + h + ',\
        					top=' + t + ',left=' + l);
        return false;
    	});
    
    $('#mask-contactMe #QR').on('click', function() {
	if( !(M = $(this).data('m')) ) {
	    $(this).animate({ width: 342, height: 342 }, 'fast').attr('src', 'media/QR_M.png');
	} else {
	    $(this).animate({ width: 196, height: 196 }, 'fast').attr('src', 'media/QR.png');
	}
	$(this).data('m', !M);
    	});
   
    $('body').removeClass('inProgress');
});